ract Production";$lang["Dispatch Remaining Raw Material of Contract Production at the End of Production"] = "Dispatch Remaining Raw Material of Contract Production at the End of Production";$lang["Good Dispatch Note Type"] = "Good Dispatch Note Type";$lang["Good Issue Note Raw Material Details"] = "Good Issue Note Raw Material Details";$lang["Edit Good Issue Note Raw Material Details"] = "Edit Good Issue Note Raw Material Details";$lang["Good Return Note Raw Material Details"] = "Good Return Note Raw Material Details";$lang["Edit Good Return Note Raw Material Details"] = "Edit Good Return Note Raw Material Details";$lang["Supplier Return Raw Material Details"] = "Supplier Return Raw Material Details";$lang["Add New Raw Material Disposal"] = "Add New Raw Material Disposal";$lang["Add Raw Material Disposal"] = "Add Raw Material Disposal";$lang["Edit Raw Material Disposal"] = "Edit Raw Material Disposal";$lang["Raw Material Disposal Raw Material Details"] = "Raw Material Disposal Raw Material Details";$lang["Edit Raw Material Disposal Raw Material Details"] = "Edit Raw Material Disposal Raw Material Details";$lang["Journal entry for raw material disposal number : "] = "Journal entry for raw material disposal number : ";$lang["Production Output Note"] = "Production Output Note";$lang["Add Production Output Note"] = "Add Production Output Note";$lang["Edit Production Output Note"] = "Edit Production Output Note";$lang["Production Output Note Raw Material Details"] = "Production Output Note Raw Material Details";$lang["Add New Production Output Note"] = "Add New Production Output Note";$lang["Edit Production Output Note Raw Material Details"] = "Edit Production Output Note Raw Material Details";$lang["Journal entry for raw material production output note number : "] = "Journal entry for raw material production output note number : ";$lang["Chart of Account to Debit Production Income Receivable"] = "Chart of Account to Debit Production Income Receivable";$lang["Alert"] = "Alert";$lang["Journal entry for raw material PON number : "] = "Journal entry for raw material PON number : ";$lang["Raw Material Batch Quantities"] = "Raw Material Batch Quantities";$lang["Journal entry for raw material warehouse stock update number : "] = "Journal entry for raw material warehouse stock update number : ";$lang["Allows to manage company locations, people, company basic information and company structure. The information adding under this module is common to the other modules of Red Cherries ERP. Module is completely implemented and available in version 5.0 Beta 1"] = "Allows to manage company locations, people, company basic information and company structure. The information adding under this module is common to the other modules of Red Cherries ERP. Module is completely implemented and available in version 5.0 Beta 1";$lang["This module consists of five sections called Administration, Finished Good Inventory, Raw Material Inventory, Sales and Reports. The Administration section allows to manage warehouses, unit and unit conversions, tax details, vehicles, delivery routes and system configurations. System configurations allow to configure the system for different behaviors. Finished Good Inventory and Raw Material Inventory allows to manage finished good and raw material stock respectively. System allows to manage warehouse and lorry stock with different transactions. Sales section allows to manage sales invoices and sales returns. Reports section allows to generate different types of reports for stock balances, transactions, sales and sales returns. Module is completely implemented and available in version 5.0 Beta 1"] = "This module consists of five sections called Administration, Finished Good Inventory, Raw Material Inventory, Sales and Reports. The Administration section allows to manage warehouses, unit and unit conversions, tax details, vehicles, delivery routes and system configurations. System configurations allow to configure the system for different behaviors. Finished Good Inventory and Raw Material Inventory allows to manage finished good and raw material stock respectively. System allows to manage warehouse and lorry stock with different transactions. Sales section allows to manage sales invoices and sales returns. Reports section allows to generate different types of reports for stock balances, transactions, sales and sales returns. Module is completely implemented and available in version 5.0 Beta 1";$lang["Allows to manage the process of producing finished goods in a production line. Careful monitoring of raw materials issued to production line and exact usage and calculate final product cost considering other costing parameters is handled in this module. Module provides variation reports to evaluate the efficiency of production line thereby adjusting parameters to fine tune the efficiency and minimize loses. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions."] = "Allows to manage the process of producing finished goods in a production line. Careful monitoring of raw materials issued to production line and exact usage and calculate final product cost considering other costing parameters is handled in this module. Module provides variation reports to evaluate the efficiency of production line thereby adjusting parameters to fine tune the efficiency and minimize loses. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions.";$lang["All employees personal details and job details can be maintained in the system. Module has features to track employee attendance details and employee leave application details. Further it allows to evaluate employee performance and employee on boarding and off bording details. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions."] = "All employees personal details and job details can be maintained in the system. Module has features to track employee attendance details and employee leave application details. Further it allows to evaluate employee performance and employee on boarding and off bording details. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions.";$lang["Allows to manage donations, reserve services(Including reserving rooms/halls etc.), trainings and other types of services. Reservations can be seen on a calendar. Further, module has features to collect advance payments and collect final payments. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions."] = "Allows to manage donations, reserve services(Including reserving rooms/halls etc.), trainings and other types of services. Reservations can be seen on a calendar. Further, module has features to collect advance payments and collect final payments. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions.";$lang["Allows to create a chart of account structure and create prime entry books. Journal entries can be added for a financial year and if required based on locations. Trial balance, balance sheet and profit and lose accounts can be generated as reports with different search options. Module is completely integrated with Stock Manager and Production Manager modules. Initial module implementation is completed and is available in version 5.0 Beta 8. Further development of remaining features will be available in future versions."] = "Allows to create a chart of account structure and create prime entry books. Journal entries can be added for a financial year and if required based on locations. Trial balance, balance sheet and profit and lose accounts can be generated as reports with different search options. Module is completely integrated with Stock Manager and Production Manager modules. Initial module implementation is completed and is available in version 5.0 Beta 8. Further development of remaining features will be available in future versions.";$lang["Admin and a normal user roles available with default user role permissions. New users can be created for type of admin or normal user. When required additional user roles can be created with custom permissions and can be assigned to users. Module is completely implemented and available in version 5.0 Beta 1."] = "Admin and a normal user roles available with default user role permissions. New users can be created for type of admin or normal user. When required additional user roles can be created with custom permissions and can be assigned to users. Module is completely implemented and available in version 5.0 Beta 1.";$lang["Sales Invoice"] = "Sales Invoice";$lang["Wholesales Invoice"] = "Wholesales Invoice";$lang["Sales Return"] = "Sales Return";$lang["Add New Sales Invoice"] = "Add New Sales Invoice";$lang["Add New Wholesales Invoice"] = "Add New Wholesales Invoice";$lang["Add Sales Invoice"] = "Add Sales Invoice";$lang["Add Wholesales Invoice"] = "Add Wholesales Invoice";$lang["Edit Sales Invoice"] = "Edit Sales Invoice";$lang["Edit Wholesales Invoice"] = "Edit Wholesales Invoice";$lang["Sales Invoice No"] = "Sales Invoice No";$lang["Wholesales Invoice No"] = "Wholesales Invoice No";$lang["Sales Invoice Date"] = "Sales Invoice Date";$lang["Sales Type"] = "Sales Type";$lang["Sales Invoice Type"] = "Sales Invoice Type";$lang["Print Sales Invoice"] = "Print Sales Invoice";$lang["Tax Sales Invoice"] = "Tax Sales Invoice";$lang["Finish Good Sale"] = "Finish Good Sale";$lang["Raw Material Sale"] = "Raw Material Sale";$lang["Sales Invoice Items"] = "Sales Invoice Items";$lang["Whole